import React from 'react';
import styled from 'styled-components';
import PropTypes from 'prop-types';
import './App.css';
import memoji from './img/memoji.png';

const svg = (
  <svg width="251" height="251" className="name-svg">
    <defs>
      <pattern id="image" patternUnits="userSpaceOnUse" height="200" width="200">
        <image x="45" y="40" height="150" width="150" xlinkHref={memoji} />
      </pattern>
      <path
        id="curve"
        d="
M 120 120
m -80, 0
a 80,80 0 1,1 160,0
a 80,80 0 1,1 -160,0
"
      />
    </defs>
    <text className="header-name" fill="black">
      <textPath
        xlinkHref="#curve"
      >
        Jade Fung
      </textPath>
      <animateTransform
        attributeType="xml"
        attributeName="transform"
        type="rotate"
        from="0,120,120"
        to="360,120,120"
        begin="0"
        dur="60s"
        repeatCount="indefinite"
      />
    </text>
    <circle id="pic" className="header-circle" cx="120" cy="90" r="110" fill="url(#image)" />
  </svg>
);

const App = ({ className }) => (
  <div className={className}>
    <div className="container mt-3">
      <div className="row fullheight">
        <div className="col-4">
          <h1>Jade Fung</h1>
          <div>
            <a href="mailto:hello@fungj.net">hello@fungj.net</a>
          </div>
          <div>
            <a href="https://github.com/overwatchcorp">github</a>
          </div>
          <div>
            <a href="https://www.linkedin.com/in/jade-fung/">linkedin</a>
          </div>
        </div>
        <div className="col">
          <p>Jade Fung is a web engineer in Portland, Oregon.</p>
        </div>
      </div>
    </div>
  </div>
);

App.propTypes = {
  className: PropTypes.string.isRequired,
};

export default styled(App)`
  @import url('https://fonts.googleapis.com/css2?family=Work+Sans:ital,wght@0,300;0,900;1,300;1,900&display=swap');
  @import url("https://use.typekit.net/dlz1dpe.css");

  /* background: red; */
  h1, h2, h3, h4, h5, h6, svg, .recessed-label {
    font-family: agnamsangjun-plain, serif;
  }
  font-family: serif;
  font-size: 32pt;
  h1 {
    font-size: 102pt;
  }

  .recessed-label {
    font-size: 62pt;
    transform-origin: 0 0;
    transform: rotate(-90deg);
  }

  .content-container {
    position: relative;
    background: #FFF;
    height: 60rem;
  }

  .fullheight {
    height: 100vh;
  }
  .name-svg {
    width: 251px;
    height: 251px;
  }
  .header-name {
    font-size: 52pt;
  }
`;
